import React from 'react'
import {BrowserRouter} from 'react-router-dom'
import {
    HashLink as Link
 } from 'react-router-hash-link'
import '../sass/layout/navbar.sass'
const Navbar = () => {
    return (
        <nav className='main-nav' aria-label='Main navigation'>
            <div className='nav-wrapper'>
            <div className='logo'>
            <span className='lineup'>BLAC</span>
                <span className='flip-text'>K</span>
                <span className='bold lineup'>ROOM</span> 
            </div>
            <div className='main-nav__list'>
                <BrowserRouter>
                <Link 
                    className='main-nav__item' 
                    spy={true}
                    smooth={true}
                    duration={700}
                    to='#who'>
                        WHO WE ARE</Link>
                <Link className='main-nav__item' to='#exhibitions'
                spy={true}
                smooth={true}
                offset={-60}
                duration={500}>OUR EXHIBITIONS</Link>
                <Link className='main-nav__item' to='#rooms'
                spy={true}
                smooth={true}
                offset={-60}
                duration={500}
                >OUR ROOMS</Link>
                <Link className='main-nav__item' to='#contact'
                spy={true}
                smooth={true}
                offset={-60}
                duration={500}
                >CONTACT</Link>
                </BrowserRouter>
            </div>
            </div>
        </nav>
    )
}

export default Navbar
